import logo from './logo.svg';
import './App.css';
import "semantic-ui-css/semantic.min.css";

import PlanDashboard from './components/PlanDashboard/PlanDashboard';
import TimerDashboard from './components/TimerDashboard/TimerDashboard';
import LoginDashboard from './components/LoginDashboard/LoginDashboard';

import { Route } from 'react-router-dom'

function App() {
  return (
    <div>
        <Route
          exact path='/'
          component={PlanDashboard}
        />
        <Route
          exact path='/login'
          component={LoginDashboard}
        />
    </div>
  );
}

export default App;
